import React, { Component } from "react";

import "./Home.css";

class Home extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}
	render() {
		return (
			<main className="side-wrapper home">
				<div className="flex" id="loader">
					{/* <img id="intro-logo" src="logo.png" alt="Brave Logo" /> */}
					<div className="intro-anime">
						<div id="black-hole" className="flex f-col">
							<div className="intro-text">
								<h2 className="brave-enough">
									<span id="be1">
										Brav<span className="a1">e</span>
									</span>
									<br />
									<span id="be2">
										<span className="a1">e</span>nough?
									</span>
								</h2>
								<p className="have-you-got">
									<p id="hy1">Have you got what it takes for our</p>
									<p id="hy2"> intership programme?</p>
								</p>
							</div>
						</div>
					</div>
				</div>

				<div id="clock">
					<span id="hours">20</span>
					<span className="in-out">:</span>
					<span id="mins">20</span>
					<span className="in-out">:</span>
					<span id="secs">00</span>
				</div>

				<div className="begin">
					<div className="pulse-btn clean flex">
						<a href="">Begin</a>
					</div>
					<div className="pulse-outer" />
				</div>
			</main>
		);
	}
}

export default Home;
